import React, { useState, useEffect, useRef } from 'react';

// Dyno Training Data (converted from YAML)
const DYNO_DATA = {
  dyno_types: {
    mustang_md250: {
      type: "load_bearing",
      correction_factor: 1.0,
      inertia: "low",
      typical_variance: 0.02,
      heat_soak_factor: 0.98
    },
    dynojet_248c: {
      type: "inertial", 
      correction_factor: 1.15,
      inertia: "high",
      typical_variance: 0.03,
      heat_soak_factor: 0.96
    }
  },
  
  training_data: {
    mazdaspeed3_2007: {
      manufacturer: "Mazda",
      model: "Mazdaspeed3", 
      engine: "2.3L Turbo I4",
      weight: 3200,
      power_curve: [
        {rpm: 2500, hp: 145, torque: 306},
        {rpm: 3000, hp: 180, torque: 315},
        {rpm: 3500, hp: 210, torque: 315},
        {rpm: 4000, hp: 225, torque: 295},
        {rpm: 4500, hp: 235, torque: 275},
        {rpm: 5000, hp: 238, torque: 250},
        {rpm: 5500, hp: 238, torque: 227},
        {rpm: 6000, hp: 232, torque: 203},
        {rpm: 6500, hp: 220, torque: 178}
      ]
    }
  }
};

// Physics Engine Class
class DynoPhysicsEngine {
  constructor(dynoType = 'mustang_md250') {
    this.dynoType = DYNO_DATA.dyno_types[dynoType];
    this.runNumber = 1;
    this.conditions = {
      temperature_f: 75,
      humidity: 0.45,
      barometric_pressure: 29.92,
      altitude: 500
    };
  }

  // Calculate environmental correction factor
  calculateEnvironmentalCorrection() {
    const { temperature_f, humidity, barometric_pressure, altitude } = this.conditions;
    
    // SAE J1349 correction formula (simplified)
    const tempCorrection = Math.sqrt(537.67 / (temperature_f + 459.67));
    const pressureCorrection = barometric_pressure / 29.23;
    const humidityCorrection = 1 - (0.047 * humidity);
    const altitudeCorrection = 1 - (altitude * 0.000035); // 3.5% per 1000ft
    
    return tempCorrection * pressureCorrection * humidityCorrection * altitudeCorrection;
  }

  // Add realistic dyno noise/variance
  addDynoVariance(value) {
    const variance = this.dynoType.typical_variance;
    const randomFactor = 1 + (Math.random() - 0.5) * 2 * variance;
    return value * randomFactor;
  }

  // Apply heat soak effect
  getHeatSoakFactor() {
    const baseFactor = this.dynoType.heat_soak_factor;
    return Math.pow(baseFactor, this.runNumber - 1);
  }

  // Main simulation function
  simulateRun(targetCurve) {
    const envCorrection = this.calculateEnvironmentalCorrection();
    const heatSoak = this.getHeatSoakFactor();
    const dynoCorrection = this.dynoType.correction_factor;
    
    return targetCurve.map(point => ({
      rpm: point.rpm,
      hp: this.addDynoVariance(point.hp * envCorrection * heatSoak * dynoCorrection),
      torque: this.addDynoVariance(point.torque * envCorrection * heatSoak),
      timestamp: Date.now() + (point.rpm - targetCurve[0].rpm) * 50 // 50ms per RPM increment
    }));
  }

  // Update conditions
  setConditions(newConditions) {
    this.conditions = { ...this.conditions, ...newConditions };
  }

  // Increment run number for heat soak
  nextRun() {
    this.runNumber++;
  }

  // Reset for new session
  reset() {
    this.runNumber = 1;
  }
}

