  const [engine] = useState(() => new DynoPhysicsEngine('mustang_md250'));
  const [simulatedData, setSimulatedData] = useState([]);
  const [conditions, setConditions] = useState({
    temperature_f: 75,
    humidity: 0.45,
    barometric_pressure: 29.92,
    altitude: 500
  });
  const [dynoType, setDynoType] = useState('mustang_md250');
  const [runNumber, setRunNumber] = useState(1);
  const [isRunning, setIsRunning] = useState(false);

  // Simulate a dyno run
  const runSimulation = () => {
    setIsRunning(true);
    engine.setConditions(conditions);
    
    // Get the target curve (Mazdaspeed3 in this example)
    const targetCurve = DYNO_DATA.training_data.mazdaspeed3_2007.power_curve;
    
    // Simulate the run
    const results = engine.simulateRun(targetCurve);
    
    // Animate the results coming in (like a real dyno)
    let currentIndex = 0;
    const animateResults = () => {
      if (currentIndex < results.length) {
        setSimulatedData(prev => [...prev, results[currentIndex]]);
        currentIndex++;
        setTimeout(animateResults, 200); // 200ms delay between points
      } else {
        setIsRunning(false);
        engine.nextRun();
        setRunNumber(engine.runNumber);
      }
    };
    
    // Clear previous data and start animation
    setSimulatedData([]);
    setTimeout(animateResults, 500);
  };

