  const peaks = simulatedData.length > 0 ? {
    maxHp: Math.max(...simulatedData.map(d => d.hp)),
    maxTorque: Math.max(...simulatedData.map(d => d.torque)),
    maxHpRpm: simulatedData.find(d => d.hp === Math.max(...simulatedData.map(p => p.hp)))?.rpm,
