        marginBottom: '20px'
      }}>
        
        {/* Environmental Controls */}
        <div style={{ 
          border: '1px solid #ddd', 
          padding: '15px', 
          borderRadius: '8px',
          backgroundColor: '#f9f9f9'
        }}>
          <h3>üå°Ô∏è Environmental Conditions</h3>
          
