            max="1" 
            step="0.01"
            value={conditions.humidity}
            onChange={(e) => setConditions(prev => ({
              ...prev, 
              humidity: parseFloat(e.target.value)
            }))}
            style={{ width: '100%', margin: '5px 0 15px 0' }}
          />
          
          <label>Altitude (ft): {conditions.altitude}</label>
          <input 
            type="range" 
            min="0" 
            max="5000" 
            step="100"
            value={conditions.altitude}
            onChange={(e) => setConditions(prev => ({
              ...prev, 
              altitude: parseInt(e.target.value)
            }))}
            style={{ width: '100%', margin: '5px 0 15px 0' }}
          />
        </div>

        {/* Dyno Settings */}
        <div style={{ 
          border: '1px solid #ddd', 
          padding: '15px', 
          borderRadius: '8px',
          backgroundColor: '#f9f9f9'
        }}>
          <h3>üîß Dyno Settings</h3>
          
          <label>Dyno Type:</label>
          <select 
            value={dynoType}
            onChange={(e) => {
              setDynoType(e.target.value);
              engine.dynoType = DYNO_DATA.dyno_types[e.target.value];
            }}
            style={{ width: '100%', margin: '5px 0 15px 0', padding: '5px' }}
          >
            <option value="mustang_md250">Mustang MD250 (Load Bearing)</option>
            <option value="dynojet_248c">DynoJet 248C (Inertial)</option>
          </select>
          
          <p><strong>Run Number:</strong> {runNumber}</p>
