            style={{
              width: '100%',
              padding: '10px',
              backgroundColor: isRunning ? '#ccc' : '#007bff',
              color: 'white',
              border: 'none',
              borderRadius: '5px',
              fontSize: '16px',
              marginBottom: '10px',
