        {peaks && (
          <div style={{ 
            border: '1px solid #ddd', 
            padding: '15px', 
            borderRadius: '8px',
            backgroundColor: '#e8f5e8'
          }}>
            <h3>üìä Peak Results</h3>
            <p><strong>Max HP:</strong> {peaks.maxHp.toFixed(1)} @ {peaks.maxHpRpm} RPM</p>
