                borderRadius: '3px'
              }}>
                <div><strong>{point.rpm} RPM</strong></div>
                <div>{point.hp.toFixed(1)} HP</div>
                <div>{point.torque.toFixed(1)} lb-ft</div>
              </div>
            ))}
          </div>
        </div>
      )}

      {/* Instructions */}
      <div style={{ 
        marginTop: '20px', 
        padding: '15px', 
        backgroundColor: '#e3f2fd', 
        borderRadius: '8px'
      }}>
